import React from 'react'
import './Login.css'

function Login() {
    return (
        <div className="login">
            <Link to="/">
                <img className="login__logo" src="http://pngimg.com/uploads/amazon/amazon_PNG11.png" alt="logo" ></img>
            </Link>
        </div>
    )
}

export default Login
